    const fetapi=fetch('https://json-server-deploy-3u69.onrender.com/').then((res)=>{
    return res.json()
    }).then((data)=>{
        console.log(data)
    }).catch((e)=>{
        console.log(e)
    })
  return (
    <> 
    <div id='cnt'>
    <h4>userdata</h4>
    <div id='tmp'>
      <span>{name}</span>
      <span>{email}</span>
      <span>time</span>
    </div>
    </div>
    </>
  )
}

export default UserName
